webpackJsonp([46998699403456],{302:function(e,t){e.exports={data:{markdownRemark:{html:'<p>The World Wide Web ("WWW" or simply the "Web") is a global information medium which users can read and write via computers connected to the Internet. The term is often mistakenly used as a synonym for the Internet itself, but the Web is a service that operates over the Internet, just as e-mail also does. The history of the Internet dates back significantly further than that of the World Wide Web. - Wikipedia</p>',frontmatter:{title:"The Beginning of The Web",author:"Oliver Queen",date:"2018-01-10"}}},pathContext:{slug:"/blog-posts/in-the-beginning/"}}}});
